import React from "react";
import Infos from "./example_data.json";

const Test = () => {
  const info = Infos.map((item) => (
    <div key={item.id}>
      <p>{item.name}</p>
      <p>{item.address}</p>
    </div>
  ));

  const y = "2";
  return <div>{info}</div>;
};

export default Test;
